import defaultAttributes from '../defaultAttributes';
import type { IconNode } from '../types';

/**
 * @name play
 * @description Lucide SVG icon node.
 *
 * @preview ![img](data:image/svg+xml;base64,) - https://lucide.dev/icons/play
 * @see https://lucide.dev/guide/packages/lucide - Documentation
 *
 * @returns {Array}
 *
 */
const Play: IconNode = ['svg', defaultAttributes, [['polygon', { points: '6 3 20 12 6 21 6 3' }]]];

export default Play;
